import React from 'react'
import { Redirect } from 'react-router-dom'

class Checkout extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            cardNumber: '',
            nameOnCard: '',
            expiration: '',
            cvc: '',
            successfull: false
        }
    }
    handleChange = (e) => {
        this.setState({
            [e.target.id] : e.target.value
        })
    }
    paymentSuccessful = () => {
        this.setState({})
    }
    render () {
        let paymentSuccessful
        return (
            <div on onClick={paymentSuccessful} className='container' >
                    <form className='teal lighten-5 z-depth-2'>
                        <h5 className='grey-text text-darken-3'> Card details</h5>
                        <div className='input-field'>
                            <label htmlFor='cardNumber'>Card number</label>
                            <input type='text' id='cardNumber' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>
                            <label htmlFor='nameOnCard'>Name on card</label>
                            <input type='text' id='nameOnCard' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>
                            <label htmlFor='expiration'>Expiraion date</label>
                            <input type='text' id='expiration' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>
                            <label htmlFor='cvc'>CVC (Security code)</label>
                            <input type='password' id='cvc' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>
                            <button className='right waves-effect waves-light btn blue lighten-2'>Confirm and Pay</button>
                            <br></br>
                        </div>
                        <div className='input-field'>
                            {paymentSuccessful}
                        </div>
                    </form>
                </div>
        )
    }
}

export default Checkout
